            service providers, and consumers. OSF creates the bridge between the worker and the finder.
          </p>
        </div>
        <div className="nsection2-div2">
          <img src="https://aonetheme.com/demo/wp-content/uploads/2016/07/bnr1.jpg"></img>
        </div>
      </section>
    </>
